import {
    BUTTON_BLOCK_COMPLETED,

} from "./types";

export const changeFlagButtonBlockCompleted = (stateLevelFinal, letter, numberLevelBlock) => {
    //все кнопки блока кликнуты, флаг true

    console.log('stateLevelFinal[letter]  ', stateLevelFinal[letter])
    console.log('arr[numberLevelBlock]  ', arr[numberLevelBlock])
    console.log('  ',)

    let arr = stateLevelFinal[letter];
    arr[numberLevelBlock] = true;

    return {
        type: BUTTON_BLOCK_COMPLETED,
        payload: arr
    }
}
